import '../App.css';
import { BrowserRoute as Router, Route, Switch } from 'react-router-dom';
import Home from './Home';
import Navbar from './Navbar';

function App() {
  return (
    <Route>
      <Navbar />

      <div className='App blue-grey darken-3'>
        <Home />
      </div>
    </Route>
  );
}

export default App;
